export default function Cards(props) {
   const { characters } = props;
   return (
   <div>
     {
      characters.map((elemento, index)=>{
         return (
         <Card 
         key={index} 
         name={elemento.name}
         species={elemento.especies}
         gender
         />)
      })
     }
   </div>
   );
}
